  const post = Fetcher.get(1).then(el => el.title);
  console.log(post);

  return (
    <Layout>
      <h1>{post}</h1>
      {/* <h1>{router.query}</h1> */}
      {/* <p>{router.query.body}</p> */}
    </Layout>
  );
}
